[Briefing] 
0=Operation: Winter Bog@Location: Crimea 
1=@--------------------------------------------------@@Congratulations, 
2=on your promotion, Colonel. There is not much time to waste.@@General 
3=McLowe is aiming to recapture one of the major cities that was 
4=previously overrun by the Soviets. The Soviets have bunkered up, but 
5=the new Heavy Artillery reinforcements should soften them.@@We are 
6=worried about his flanks though. General McLowe thinks he can capture 
7=the city and open its port for naval reinforcements in time, and High 
8=Command is too convinced by his confidence to consider otherwise.@@Do 
9=what you can to assist him and take the city. 

[Tutorial] 
1=Report to the Tactical Center at the northeastern base. 
2=The Allied Forces have begun attacking the city! 
3=GENERAL MCLOWE: You are late. The attack has already started. 
4=GENERAL MCLOWE: But no matter, take control of one of our bases, 
5=so I can free one of my colonels for the offensive. 
6=Take control of one of the bases by driving to the base's Radar Dome / Comm Center. 
7=The northern base has been handed to your control. 
8=The frontier base has been handed to your control. 
9=The rearguard base has been handed to your control. 
10=The southern base has been handed to your control. 
11=GENERAL MCLOWE: Nice try, but take a different base. 
12=Warning: Due to poor weather, Allied units have reduced sight and movement speed. 
13=Hint: The Mobile Radar can uncover fog of war further than most of your units. 
14=Warning: Winter storm! Vision has been further reduced! 
15=Winter storm has subsided. For now. 
17=Your forces have been wiped out - Mission Failed 
16=The Allies has transferred $5000 to you. 
18=GENERAL MCLOWE has been killed - Mission Failed 
19=Warning: Reports inbound that Russians are hammering on our flanks. We should prepare. 
20=We have breached the city and are within sight of the fortress! 
21=Warning: Our flanks are under attack! 
22=Support the offensive for the city. 
23=The situation is dire. We have to convince MCLOWE to retreat. 
24=Hold your ground until GENERAL MCLOWE approves of the retreat. 
25=The Tactical Command Center must survive. 
26=GENERAL MCLOWE: This is not a good day. Get us out of here. 
27=Escort GENERAL MCLOWE to any one of the dirt roads leading off the west of the map. 
28=Good. Let us return to safe ground. 
29=Reinforcements have arrived near the rear base. 

